Que, el Hospital del Salvador necesita contar con un CONVENIO SUMINISTRO DE MEDICAMENTOS ONCOLÓGICOS G-10 EN CASO DE NO DESPACHO DE CENABAST PARA EL HOSPITAL DEL SALVADOR con la finalidad de satisfacer de manera adecuada y eficiente la labor asistencial durante el periodo 2023-2025.

